import React from "react";
import vidbg from '../Assets/boat.mp4'
import logo from '../Assets/logo_boat.jpg'

const Main = () => {
    return (
        <div className="main">
            <div className="overlay"></div>
            <div className="navbar"> 
                    <img src={logo} />
                </div>
            <video src={vidbg} autoPlay loop muted />
            <div className="content">
                <h1> Amandx India Pvt Ltd</h1>
                <p>Connecting Commerce, Globally</p>
            </div>
        </div>
    );
}

export default Main;
